import react, { useState } from "react";


export default function EditBooks({books}){
    const init = {
        isbn: "",
        title: "",
        author: "",
        publisher: "",
        publishYear: "",         
    }

    const [book, setBook] = useState({...init})

    return(
        <div>
             <table>
                <thead><tr><td>isbn</td><td>Title</td><td>author</td><td>publisher</td><td>publish year</td></tr></thead>
                <tbody>{books.map((p) => {
                    return (
                        <tr key={p.isbn}>
                          <td>{p.isbn}</td>
                          <td>{p.title}</td>
                          <td>{p.authors}</td>
                          <td>{p.publisher}</td>
                          <td>{p.publishYear}</td></tr>
                        )
                })}</tbody>
            </table>
  );
        </div>
    );
}
